import React from 'react';
import ListingTodoModel from '../../models/todoModel'
import './index.css';
type ListingProps = {
  modelList:Array<ListingTodoModel>,
  onClickStriker: (model:ListingProps) => void
}

function ListingComponent({modelList}:ListingProps) {
return (
<div className="listContainer">
<ul>
{modelList.map(element=><li >{element.listingTitle}</li>)}
</ul>
</div>
)
}

export default ListingComponent;
